	public static ArrayList<Integer> find_mcs(int[][] S, boolean[] rev, int t, ArrayList<ArrayList<Integer>> not_allowed_css) throws IloException {
		int m = S.length;
		int n = S[0].length;
		
	 	IloCplex cplex = new IloCplex();
		IloNumVar[] a = cplex.intVarArray(m, -C, C);
		IloNumVar[] v = cplex.intVarArray(n, -C, C);
		IloNumVar[] rp = cplex.boolVarArray(n);
		IloNumVar[] rn = cplex.boolVarArray(n);
		
		IloLinearNumExpr obj = cplex.linearNumExpr();
		for(int i=0; i<n; i++)
			if (i!=t)
				if (rev[i]) {
					obj.addTerm(1, rp[i]);
					obj.addTerm(1, rn[i]);
				}else
					obj.addTerm(1, rn[i]);
		cplex.addMinimize(obj);
		
		IloLinearNumExpr[] linears = new IloLinearNumExpr[n];
		IloLinearNumExpr[] v_terms = new IloLinearNumExpr[n];
		IloLinearNumExpr[] r_terms = new IloLinearNumExpr[n];
		IloLinearNumExpr[] rp_terms = new IloLinearNumExpr[n];
		IloLinearNumExpr[] rn_terms = new IloLinearNumExpr[n];
		IloLinearNumExpr[] crp_terms = new IloLinearNumExpr[n];
		IloLinearNumExpr[] crn_terms = new IloLinearNumExpr[n];
		for(int i=0; i<n; i++) {
			v_terms[i] = cplex.linearNumExpr();
			v_terms[i].addTerm(1, v[i]);
			r_terms[i] = cplex.linearNumExpr();
			r_terms[i].addTerm(1, rp[i]);
			r_terms[i].addTerm(1, rn[i]);
			rp_terms[i] = cplex.linearNumExpr();
			rp_terms[i].addTerm(1, rp[i]);
			rn_terms[i] = cplex.linearNumExpr();
			rn_terms[i].addTerm(1, rn[i]);
			crp_terms[i] = cplex.linearNumExpr();
			crp_terms[i].addTerm(C, rp[i]);
			crn_terms[i] = cplex.linearNumExpr();
			crn_terms[i].addTerm(-C, rn[i]);
		}
		
		//Linear combinations
		for(int i=0; i<n; i++) {
			linears[i] = cplex.linearNumExpr();
			for(int j=0; j<m; j++)
				linears[i].addTerm(S[j][i], a[j]);
			cplex.addEq(linears[i], v_terms[i]);
		}
		
		//Support constraints
		IloLinearNumExpr[] sp_expr = new IloLinearNumExpr[n];
		IloLinearNumExpr[] sn_expr = new IloLinearNumExpr[n];
		for(int i =0; i<n; i++) {
			cplex.addLe(v_terms[i], crp_terms[i]);
			cplex.addGe(v_terms[i], crn_terms[i]);
			sp_expr[i] = cplex.linearNumExpr();
			sn_expr[i] = cplex.linearNumExpr();
			sp_expr[i].addTerm(C, rp[i]);
			sp_expr[i].addTerm(-1, v[i]);
			cplex.addLe(sp_expr[i], C-1);
			sn_expr[i].addTerm(C, rn[i]);
			sn_expr[i].addTerm(1, v[i]);
			cplex.addLe(sn_expr[i], C-1);
		}
		
		//cut-set forces
		cplex.addEq(rp_terms[t], 1);
		cplex.addEq(rn_terms[t], 0);
		
		//remove not allowed cut-sets from feasible space
		IloLinearNumExpr[] cs_removal_expr = new IloLinearNumExpr[not_allowed_css.size()];
		for(int index=0; index<not_allowed_css.size(); index++) {
			ArrayList<Integer> cs = not_allowed_css.get(index);
			cs_removal_expr[index] = cplex.linearNumExpr();
			for(int i:cs) {
				if(rev[i])
					cs_removal_expr[index].addTerm(1, rp[i]);
				cs_removal_expr[index].addTerm(1, rn[i]);
			}
			cplex.addLe(cs_removal_expr[index], cs.size()-1);
		}
		
		if(cplex.solve()) {
			print_fluxes(getInts(cplex, v));
			System.err.println(not_allowed_css.size()+1);
			ArrayList<Integer> cs = get_CS(getBools(cplex, rp), getBools(cplex, rn), rev, t);
			cplex.end();
			return cs;
		}
		cplex.end();
		System.err.println(cplex.getStatus());
		return null;
		
	}
	public static boolean[] getBools(IloCplex cplex, IloNumVar[] bools) throws UnknownObjectException, IloException {
		boolean[] ans = new boolean[bools.length];
		for(int i=0; i<bools.length; i++)
			ans[i] = cplex.getValue(bools[i])!=0.0;
		return ans;
	}
	public static int[] getInts(IloCplex cplex, IloNumVar[] ints) throws UnknownObjectException, IloException {
		int[] ans = new int[ints.length];
		for(int i=0; i<ints.length; i++)
			ans[i] = (int)cplex.getValue(ints[i]);
		return ans;
	}
	
	public static void print_fluxes(int[] v) throws UnknownObjectException, IloException {
		System.err.print("{");
		for(int i=0; i<v.length; i++) {
			System.err.print(v[i]);
			if(i!=v.length-1)
				System.err.print(", ");
		}
		System.err.print("}\n");
	}
	public static ArrayList<Integer> get_CS(boolean[] rp, boolean[] rn, boolean[] rev, int t) throws UnknownObjectException, IloException {
		ArrayList<Integer> cs = new ArrayList<>();
		for(int i=0; i<rev.length; i++) {
			if (i==t)
				continue;
			if(rev[i]) {
				if(rp[i]||rn[i])
					cs.add(i);
			}else if (rn[i])
					cs.add(i);
		}
		
		System.err.print("Cut-set: ");
		for(int i=0; i<cs.size(); i++) {
			System.err.print(cs.get(i)+1);
			if(i!=cs.size()-1)
				System.err.print(", ");
		}
		System.err.print("\n");
		return cs;
	}

